    /**
     * Mtodo: syntax_error
     * Objetivo: Manejar los errores sintcticos encontrados durante el anlisis sintctico.
     * Entradas:
     *   - s: Objeto de tipo Symbol que contiene informacin sobre el error sintctico, como la posicin y el token involucrado.
     * Salida: Ninguna.
     * Restricciones: Se espera que el objeto Symbol contenga informacin vlida de posicin y token.
     */
    @Override
    public void syntax_error(Symbol s) {
        errorCount++;
        System.err.println("Error sintctico en lnea " + (s.left + 1) +
                           ", columna " + (s.right + 1) + ". Token inesperado: " + s.value);
    }

    /**
     * Mtodo: hasErrors
     * Objetivo: Verificar si se han registrado errores durante el anlisis sintctico.
     * Entradas: Ninguna.
     * Salida: Booleano que indica si existen errores (true si hay errores, false sino).
     *         Se utiliza en la clase MainJFlexCup para indicar si el archivo puede generarse
     * Restricciones: La variable errorCount debe haber sido correctamente inicializada y actualizada.
     */
    public boolean hasErrors() {
        return errorCount > 0;
    }

